import React from "react";
import { Link, useHistory } from "react-router-dom/cjs/react-router-dom.min";
import { Redirect } from 'react-router-dom';
import { useState } from "react";

export const Register = () => {

    const [statue, Setstatue] = useState('False');

    const Handleclick = () => {
        Setstatue('True');
    }

    if (statue === 'True') {
        return <Redirect to="/contact"/>;
    }
    return (
        <div className="register">
            <form onSubmit={Handleclick}>
                <p></p>
                <label htmlFor="email">Email</label><p></p>
                <input type="email" placeholder="Email" /><p></p>
                <label htmlFor="Password">Password</label><p></p>
                <input type="password" placeholder="**********"/><p></p>
                <button type="submit">Register</button>
                <Link to="/login">
                    <button>Already an account ?</button>
                </Link>
            </form>
        </div>
    );
}
